    [],nt"revision_timestamp": "2016-07-27T23:06:37.321178",nt"name": "prairie-reconstruction-initiative",nt"isopen":
    false,nt"url": null,nt"notes": "The purpose of the Prairie Reconstruction
    Initiative Advisory Team (PRIAT) is to identify and take steps to resolve uncertainties
    in the process of prairie reconstruction so that future efforts are cost-effective
    and meet management objectives.  PRIAT recognizes a that a diversity of specific
    management objectives exists among practitioners and strives to 1) identify basic
    objectives, developmental stages, necessary progressions of tasks and definitions
    of success inherent in all prairie reconstructions and 2) understand when differences
    in objectives or site conditions necessarily result in divergence in prairie reconstruction
    approaches and measures of success. The PRIAT therefore includes a diversity of
    public and private prairie reconstruction practitioners and researchers who seek
    to find ways to achieve these things by sharing collective knowledge of the larger
    prairie reconstruction community of practice, by investigating problems through
    scientific experimentation, documentation, literature searches, and monitoring protocol
    development and application.",nt"license_title": "License Not Specified",nt"extras":
